def get_C18_CURPop(lattd, longtd):
    ''' Take latitude and longitude as input, returns the 2018 Census Population.'''
    url = 'https://koordinates.com/services/query/v1/vector.json'

    params = {
        'key': '6cb7d41528f54f0f9aa37216fedecec0',
        'layer': '104612',
        'x': longtd,
        'y': lattd
    }

    response = requests.get(url, params=params)

    if response.status_code != 200:
        return pd.Series({'C18_CURPop' : response.status_code})

    C18_pop = response.json()['vectorQuery']['layers']['104612']['features'][0]['properties']['C18_CURPop']
    return pd.Series({'C18_CURPop' : C18_pop})
